import {StatusBar} from 'expo-status-bar';
import React, {useEffect} from 'react';
import {StyleSheet, Text, View} from 'react-native';
import {OrderWatcher, OrderWatcherClient} from "./_proto/orderWatcher_pb_service";
import {Request} from "./_proto/orderWatcher_pb";
import {grpc} from "@improbable-eng/grpc-web";
import {ReactNativeTransport} from '@improbable-eng/grpc-web-react-native-transport';

export default function App() {

    const host = "http://localhost:8080";
    const grpcClient = new OrderWatcherClient(host);


    useEffect(() => {



        (() => {
            const customer = new Request()
            customer.setId(1)
            const orderStream = grpcClient.subscribe(customer);
            orderStream.on("data", (chunk) => {
                const msg = (chunk as StreamMessage).toObject();
                console.log(msg);
                setMessages((prev) => [...prev, msg]);
            });
        })();

        grpc.invoke(OrderWatcher.Subscribe, {
          request: customer,
          host: host,
          transport: ReactNativeTransport({ withCredentials: false }),
          onMessage: (message: any) => {
            console.log("got book: ", message.toObject());
          },
          onEnd: (code: grpc.Code, msg: string | undefined, trailers: grpc.Metadata) => {
            if (code == grpc.Code.OK) {
              console.log("all ok")
            } else {
              console.log("hit an error", code, msg, trailers);
            }
          }
        });

    }, []);


    return (
        <View style={styles.container}>
            <Text>Open up App.tsx to start working on your app!</Text>
            <StatusBar style="auto"/>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
});
